import React from 'react'
import {AddPhotoAlternate} from 'styled-icons/material-outlined';


import {
    Container,
    Body,
    Content,
    Texto,
    Bottom,
    Icon,
    Button,


  } from './styles';

const Input : React.FC = () =>  {
    return (  
        <Container>
            <Body>
                <Content>
                    <Texto>
                        <textarea rows={2} placeholder="Criar um evento"/>
                    </Texto>

                    <Bottom>
                        <Icon> 
                            <AddPhotoAlternate height={25}/>
                        </Icon>
                        <Button>
                            <span>Postar</span>
                        </Button>
                    </Bottom>
                </Content>
            </Body>
        </Container>

    );
};

export default Input;
